import React from 'react';
import './App.css';

export default function(){
  return (
    <React.Fragment>
      <div style = {{width:"100%",height:"300%",textAlign:"center"}}>
        <iframe src="https://giphy.com/embed/ocuQpTqeFlDOP4fFJI" frameBorder="0" class="noHover" allowFullScreen style = {{width:"100%",height:"300%"}}>
        </iframe>
      </div>
      <span style={{color:"#6a197d"}}>GPS Dashboard</span>
    </React.Fragment>
  );
}
